# (C) Copyright 2019 StackHPC Limited. # # Licensed under the Apache License, Version 2.0 (the "License"); # you may not use this file except in compliance with the License. # You may obtain a copy of the License at # # http://www.apache.org/licenses/LICENSE-2.0 # # Unless required by applicable law or agreed to in writing, software # distributed under the License is distributed on an "AS IS" BASIS, # WITHOUT WARRANTIES OR CONDITIONS OF ANY KIND, either express or # implied. # See the License for the specific language governing permissions and # limitations under the License. import sys import os from oslo_config import cfg from oslo_log import log from monasca_persister import config from monasca_persister.repositories.influxdb import metrics_repository LOG = log.getLogger(__name__) def usage(): usage = """Monasca InfluxDB tool for migration to database per tenant Used to move data from monolithic database e.g. `monasca` to a database per tenant model, e.g. `monasca_<tenant_id>`. Please see the included README.rst for more details about creating an appropriate configuration file. migrate-to-db-per-tenant.py [-h] --config-file <ini> -h --help Prints this --config-file <ini> (Required) Configuration file as described in README.rst Example: migrate-to-db-per-tenant.py --config-file <path>/persister.ini """ print(usage) unit = 'd' mult = dict(w=1, d=7) rp_2w = dict(end=mult[unit]*2, rp=dict(name='2w', duration='2w', replication='1', default=True)) migrate_query_template = ('SELECT * INTO "{target_db}"..:MEASUREMENT' ' FROM "{measurement}"' ' WHERE _tenant_id='{tenant_id}'' ' AND time > {lower_time_offset}' ' AND time <= {upper_time_offset}' ' GROUP BY *') class MigrationHelper(object): def __init__(self): config.parse_args() repo = metrics_repository.MetricInfluxdbRepository() self.client = repo._influxdb_client self.conf = repo.conf def _migrate(self, measurement, tenant_id, start_time_offset, end_time_offset, target_db='target', retention_policy={}, time_unit='w', db_per_tenant=True, **kwargs): total_written = 0 first_upper_time_offset = None last_lower_time_offset = None time_offset = start_time_offset if db_per_tenant: target_db = "{}_{}".format(target_db, tenant_id) self.client.create_database(target_db) if retention_policy: self.client.create_retention_policy(database=target_db, **retention_policy) log.info(' into {}:'.format(target_db)) while end_time_offset > 0 and time_offset < end_time_offset: lower_time_offset = 'now()-{}{}'.format(time_offset + 1, time_unit) upper_time_offset = 'now()-{}{}'.format(time_offset, time_unit) if not first_upper_time_offset: first_upper_time_offset = upper_time_offset migrate_query = migrate_query_template.format( target_db=target_db, measurement=measurement, tenant_id=tenant_id, lower_time_offset=lower_time_offset, upper_time_offset=upper_time_offset, ) log.debug(migrate_query) written = next(self.client.query(migrate_query).get_points('result')).get('written') total_written += written time_offset += 1 if written > 0: last_lower_time_offset = lower_time_offset if time_offset % 10 == 0: log.info(" migrated {} entries from {} -> {} (cumulative {})".format( written, lower_time_offset, upper_time_offset, total_written, )) else: log.info(".", end="") sys.stdout.flush() log.info(" finished migrating a total of {} entries from {} -> {}.".format( total_written, last_lower_time_offset, first_upper_time_offset, )) def get_measurements(self, fname): measurements = [] if fname: with open(fname, 'a+') as f: measurements = [l.strip() for l in f.readlines()] if not measurements: measurements = [m.get('name') for m in self.client.query('SHOW MEASUREMENTS').get_points('measurements')] if fname: with open(fname, 'w') as f: for r in measurements: f.write(r + '
') return measurements def get_tenancy(self, measurements): result = self.client.query("SHOW TAG VALUES WITH KEY = _tenant_id") return {m: [t.get('value') for t in result.get_points(m)] for m in measurements} def get_complete(self, fname): if fname: with open(fname, 'a+') as fd: return {l.strip() for l in fd.readlines()} else: return {} def migrate(self, tenant_defaults={}, default_end_time_offset=52*5, default_start_time_offset=0, skip_functions=[], measurements_file=None, success_file=None, failure_file=None, **kwargs): measurements = self.get_measurements(measurements_file) tenancy = self.get_tenancy(measurements) done = self.get_complete(success_file) skip = set() fail = set() if failure_file: if os.path.exists(failure_file): os.remove(failure_file) todo = [] for measurement in measurements: if any([f(measurement) for f in skip_functions]): skip.add(measurement) continue elif measurement in done: continue else: todo.append(measurement) for i, measurement in enumerate(todo): log.info('Migrating {}'.format(measurement)) try: for tenant_id in tenancy.get(measurement): start_time_offset = tenant_defaults.get(tenant_id, {}).get('start', default_start_time_offset) end_time_offset = tenant_defaults.get(tenant_id, {}) .get('end', default_end_time_offset) retention_policy = tenant_defaults.get(tenant_id, {}) .get('rp', {}) self._migrate(measurement, tenant_id, start_time_offset=start_time_offset, end_time_offset=end_time_offset, retention_policy=retention_policy, **kwargs) if success_file: with open(success_file, 'a+') as fd: fd.write('{}
'.format(measurement)) done.add(measurement) except Exception as e: log.error(e) if failure_file: with open(failure_file, 'a+') as fe: fe.write('{}	{}
'.format(measurement, e)) fail.add(measurement) log.info("{}/{} (done {} + skip {} + fail {})/{}".format(i+1, len(todo), len(done), len(skip), len(fail), len(measurements))) def main(): default_end_time_offset = mult[unit]*52*5 # 5 years tenant_defaults = { # e.g. "03cc1b94463c44e791222cb82008b8b1": rp_2w, } skip_functions = [] # e.g. [lambda x: x.startswith('log.')] helper = MigrationHelper() helper.migrate(skip_functions=skip_functions, time_unit=unit, tenant_defaults=tenant_defaults, default_end_time_offset=default_end_time_offset, default_start_time_offset=0, measurements_file='migrate-measurements.log', success_file='migrate-success.log', failure_file='migrate-failure.log') return 0 if __name__ == "__main__": sys.exit(main())
